double icub_id_check_residual(double *target, double *multiplicand) {
  /* Returns the squared 2-norm of lhs - A*rhs. */
  /* Reuses v to find the residual. */
  int i;
  double residual;
  residual = 0;
  icub_id_matrix_multiply(icub_id_work.v, multiplicand);
  for (i = 0; i < 124; i++) {
    residual += (target[i] - icub_id_work.v[i])*(target[i] - icub_id_work.v[i]);
  }
  return residual;
}
